use dictionarydb;

create table en_ch_dicts
(
    id       int auto_increment
        primary key,
    word     varchar(255)  not null,
    meaning  text          not null,
    priority int default 0 null
)
    CHARACTER SET = utf8mb4 
	COLLATE = utf8mb4_general_ci;
	
create index idx_word
    on en_ch_dicts (word);

